        { name: 'C', value: 45 },
        { name: 'D', value: 60 },
        { name: 'E', value: 20 },
        { name: 'F', value: 90 },
        { name: 'G', value: 55 },
    ];

    return (
        <div style={{ padding: '20px' }}>
            <h1>Bar Chart with D3</h1>
            <Barchart/>
        </div>
    );
};

export default App;
